import React from 'react';
import './Navbar.css';

function Navbar() {
  return (
    <div className="header">
      <nav>
        <div className="logo">
          <a href="/">
            <img src='/src/Images/image.png' alt="Logo" />
          </a>
        </div>
        <ul>
          <li><a href="#">About</a></li>
          <li><a href="#">Contract</a></li>
        </ul>
        <div className="signin_signup">
          <li><a href="#">Sign In/Up</a></li>
        </div>
      </nav>
    </div>
  );
}

export default Navbar;
